import React from 'react';
import Match from './match.js';

const MatchList = ({ userId, matches }) => {
  return (
    <div className="match-list">
      {matches.map((match) => (
        match ? (<Match key={match.matchId} userId = {userId} match={match} />
        ) : null))
        })
    </div>
  );
};

export default MatchList;
